import React from 'react';

// nodejs library that concatenates classes
import classNames from "classnames";
// react plugin used to create charts
import { Line, Bar } from "react-chartjs-2";
import PieChart from 'variables/PieChart';

import {
    Button,
    ButtonGroup,
    Card,
    CardHeader,
    CardBody,
    CardTitle,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    UncontrolledDropdown,
    Label,
    FormGroup,
    Input,
    Table,
    Row,
    Col,
    UncontrolledTooltip,
  } from "reactstrap";

  import {
    LineChart_ProductionTime, 
    LineChart_DefectRate,
    LineChart_Defects,
    LineChart_ProductionOutput, 
  } from "variables/charts.js";




const DefectRate = ({title, LineChart_ProductionOutput_Example1, LineChart_ProductionTime_Example1, LineChart_Defects_Example1, LineChart_DefectRate_Example1}) => {



      if (title == 4){
        return (
            <> 

            <Col xs="12">
              <Card className="card-chart">
                <CardHeader>
                  <Row>
                    <Col className="text-left" sm="6">
                      <CardTitle tag="h3">Defect Rate </CardTitle>
                    </Col>
                    <Col sm="6">

                    </Col>
                  </Row>
                </CardHeader>
                <CardBody>
                  <div className="chart-area">
                    <Line
                      data={LineChart_DefectRate[LineChart_DefectRate_Example1]}
                      options={LineChart_DefectRate.options}
                    />
                  </div>
                </CardBody>

              </Card>
            </Col>

     </>
        )
    }


    else{
    return (
        null


    );}
};

export default DefectRate;
